func TestInverse(t *testing.T) {
	a := Matrix{
		{0, 1, 0, 0},
		{0, 2, 0, 0},
		{0, 0, 0, 3},
		{0, 0, 0, 0},
	}
	ea := Matrix{
		{1, 1, 2, 6},
		{0, 1, 2, 6},
		{0, 0, 1, 3},
		{0, 0, 0, 1},
	}
	b := Matrix{
		{2, 3, 1},
		{0, 1, 3},
		{1, 2, 5},
	}
	eb := Matrix{
		{-1 / 6, -13 / 6, 4 / 3},
		{1 / 2, 3 / 2, -1},
		{-1 / 6, -1 / 6, 1 / 3},
	}
	c := Matrix{
		{0, 1, 2},
		{1, 1, 4},
		{2, -1, 0},
	}
	ec := Matrix{
		{2, -1, 1},
		{4, -2, 1},
		{-3 / 2, 1, -1 / 2},
	}
	d := Matrix{
		{1, 2, 3},
		{2, 2, 1},
		{3, 4, 3},
	}
	ed := Matrix{
		{1, 3, -2},
		{-3 / 2, -3, -5 / 2},
		{1, 1, -1},
	}
	e := Matrix{
		{1, -5, -2},
		{-1, 3, 1},
		{3, -4, -1},
	}
	ee := Matrix{
		{1, 3, 1},
		{2, 5, 1},
		{-5, -11, -2},
	}
	tests := []struct {
		a  Matrix
		ea Matrix
	}{
		{a, ea},
		{b, eb},
		{c, ec},
		{d, ed},
		{e, ee},
	}

	for i, tt := range tests {
		res, ok := tt.a.Inverse()
		if ok {
			t.Log(res)
		} else {
			t.Logf("第%d个矩阵没有逆矩阵", i)
		}
	}
}


